// Function to convert RGB to Hex
function rgbToHex(theColor) {
  r = Math.round(theColor[0] * 255).toString(16)
  if (r.length < 2) r = "0" + r;
  g = Math.round(theColor[1] * 255).toString(16)
  if (g.length < 2) g = "0" + g;
  b = Math.round(theColor[2] * 255).toString(16)
  if (b.length < 2) b = "0" + b;
  return "#" + r + g + b;
}


